import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";

const Realistions = () => {
    return (
        <section id="#Realistions">
            <Navbar />
            <h3>Découvrez mes projets réalisés, qui mettent en avant mon expertise en matière de développement web.</h3>
            <iframe src="./project/iss09_php_version/index.php" title="Mon projet"></iframe>
            <Footer />
        </section>
    )
}

export default Realistions;
